import React from "react";
import '../css/modal.css'
function Modal ({ selectedImage, setSelectedImage }) {
  return (
    <div className="overlay">
      <div className="displayImage">
        <img src={selectedImage} alt="selectedImage" />
      </div>
    </div>
  );
}
export default Modal;
